  /**
   * Payload-extraction unit tests.
   * @return {[type]} [description]
   */
  describe('payload extraction', function() {

    beforeEach(function() {
      testData = getDummyPayload();
    });

    it('allKeysInObjHavingNonObjValue: should successfully find all keys in the payload object and print them.', function() {
      // get all keys in obj
      expected = [ 
        "PROBE", "TIMESTAMP",
        "ParentObj1.Child1", "ParentObj1.Child2.Grandchild2", "ParentObj1.Child2.Grandchild2", "ParentObj1.Child3",
        "Array1", "Array2",
        "ParentObj2.ArrayChild1", "ParentObj2.ArrayChild2"
         ];
      var actual = testableObj.allKeysInObjHavingNonObjValue("", testData[0], 0);
      cbs.dbgLog('actual = ' + actual, "FunfImporterTests.allKeysInObjHavingNonObjValue");

      testArrayLengthAndContents(expected, actual);
    });

    it('groupByProbeType: should group all probe samples by their PROBE value, returning the non-namespaced strings of each probe.', function() {
      testData = getMessageSamples();
      expected = [
        "AccelerometerSensorProbe",
        "HardwareInfoProbe",
        "BatteryProbe",
        "BluetoothProbe",
        "ActivityProbe",
        "WifiProbe"
      ];

      var payloads = _.map(_.pluck(testData, "Payload"), function (p) { return JSON.parse(p); });
      // cbs.dbgLog('_.first(payloads) = ' + _.first(payloads) + '; 2nd = ' + JSON.stringify(payloads[1]) + '; _.last(payloads) = ' + _.last(payloads));
      var payloadsConcat = _.reduce(payloads, function(memo, i) { return memo.concat(i); });
      var groups = testableObj.groupByProbeType(payloadsConcat);
      var actual = _.keys(groups); 
      cbs.dbgLog('actual = ' + actual);

      testArrayLengthAndContents(expected, actual);
    });

  });


